import VueRouter from 'vue-router'
import Vue from 'vue'

Vue.use(VueRouter)

const routes =
    [
    {
        path: '/datastc',
        name: 'datastc',
        component: () => import('../components/Data_Sructure'),
        children: [
            {path: 'undrc_graph',component: () => import('../components/Data_Sructure') },
            {path: 'oriented',component: () => import('../components/Data_Sructure')}
        ] 
    },
    {
        path: '/algintro',
        name: 'algintro',
        component: () => import('../components/AlgIntro.vue') 
    },
    {
        path: '/algcmp',
        name: 'algcmp',
        component: () => import('../components/Algcmp.vue'),
        children: [
            {path: 'upload',component: () => import('../components/Algcmp_upload.vue') },
            {path: 'example',component: () => import('../components/Algcmp_example.vue') },
        ] 
    },
    {
        path: '/literature',
        name: 'literature',
        component: () => import('../components/Lit.vue') 
    },
    ]

const router = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes
})

export default router
